import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import BeansService from "../services/beans-service";
import "../css/product.css";

const ProductComponent = ({ currentUser, setCurrentUser }) => {
  const navigate = useNavigate();
  const [beanData, setBeanData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [message, setMessage] = useState("");

  useEffect(() => {
    let _id;
    if (currentUser) {
      _id = currentUser.user._id;
      if (currentUser.user.role === "store") {
        BeansService.getStoreBeans(_id)
          .then((data) => {
            setBeanData(data.data);
            setLoading(false);
          })
          .catch((error) => {
            console.log(error);
            setLoading(false);
          });
      }
    }
  }, [currentUser]);

  const handleEditProduct = async (beanId) => {
    try {
      const response = await BeansService.getBeanById(beanId);
      navigate(`/editproduct/${beanId}`, {
        state: { beanData: response.data },
      });
      setLoading(false);
      console.log(response.data);
    } catch (error) {
      setMessage("載入商品資料失敗");
      setLoading(false);
    }
  };

  if (loading) {
    return <div className="loading">載入中...</div>;
  }

  return (
    <div className="product-container">
      {currentUser && currentUser.user.role === "store" && (
        <div className="product-header">
          <h1 className="product-title">商品管理</h1>
          <button
            className="new-product-btn"
            onClick={() => navigate("/postproduct")}
          >
            <i className="fas fa-plus"></i>
            新增商品
          </button>
        </div>
      )}

      {currentUser && beanData && beanData.length > 0 ? (
        <div className="products-grid">
          {beanData.map((bean) => (
            <div className="product-card" key={bean._id}>
              <div className="product-image-container">
                {!bean.image ||
                bean.image === "" ||
                bean.image === "/uploads/beans/default.jpg" ? (
                  <div className="no-image-container">
                    <i className="fas fa-image"></i>
                    <span>尚未上傳圖片</span>
                  </div>
                ) : (
                  <img
                    src={`http://localhost:8080${bean.image}`}
                    alt={bean.title}
                    className="product-image"
                  />
                )}
              </div>
              <div className="product-card-body">
                <h5 className="product-card-title">{bean.title}</h5>
                <div className="price-tag">${bean.price}</div>

                <div className="product-info">
                  <i className="fas fa-weight"></i>
                  重量：{bean.weight}g
                </div>

                <div className="product-info">
                  <i className="fas fa-mortar-pestle"></i>
                  處理法：{bean.processing}
                </div>

                <div className="product-info">
                  <i className="fas fa-fire"></i>
                  烘焙程度：{bean.roast}
                </div>

                <div className="product-info">
                  <i className="fas fa-seedling"></i>
                  品種：{bean.cultivar}
                </div>

                <p className="product-description">{bean.description}</p>

                <div className="sales-info">
                  <i className="fas fa-chart-line"></i>
                  <span className="sales-info-text">已售出：</span>
                  <span
                    style={{ paddingTop: "0.8rem" }}
                    className="sales-count"
                  >
                    {bean.customers.length}
                  </span>
                </div>
              </div>

              <button
                className="edit-product-btn"
                onClick={() => handleEditProduct(bean._id)}
              >
                編輯商品
              </button>
            </div>
          ))}
        </div>
      ) : (
        <div className="no-products">目前沒有商品</div>
      )}
    </div>
  );
};

export default ProductComponent;
